@unitedanceshowcase - Welcome to Burlesque - Choreographed by yours truly 😇

Huge thank you to my dancers for trusting me and specifically these ladies who always answer when I call 😭
@jonna_abrams @melhart1 @ponytailpatricia @patricialunardo @_katgayle @cheyennechante 
I really had an ALL STAR cast of SEASONED dancers who pulled this off with minimal rehearsals. I couldn’t be prouder of how this turned out, and you should all be really proud of yourselves as well. Thank you for making the process fun, safe, and creative. For allowing me to explore, and bouncing ideas off me. I can’t wait to continue working with all of you. ALSO - Toronto - book themmmmm. Love you all so much, this was special 🤍

To @kianakikismith girl if you didn’t tell me to do this show, there was no way I was gonna showcase again probably for another while so thank you for pulling me out. I appreciate you. 

To my outside eyes @juliofuentes @carla_catherwood - thank you both for your expertise. I appreciate and look up to you both SO much you have no idea. Your tidbits are what helped make the piece what it was! 🥰

Enjoy! This is a true performance piece and what we like to call entertainmentttttt 🥵 - the kind words last night and the messages are so appreciated. Thank you all x 

